iable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1304","type":"CustomJS"},{"attributes":{"overlay":{"id":"1203"}},"id":"1198","type":"BoxZoomTool"},{"attributes":{"data":{},"selected":{"id":"1104"},"selection_policy":{"id":"1103"}},"id":"1087","type":"ColumnDataSource"},{"attributes":{"data_source":{"id":"1087"},"glyph":{"id":"1088"},"hover_glyph":null,"muted_glyph":null,"nonselection_glyph":{"id":"1089"},"view":{"id":"1091"}},"id":"1090","type":"GlyphRenderer"},{"attributes":{"active_drag":{"id":"1019"},"active_multi":null,"active_scroll":{"id":"1020"},"tools":[{"id":"1019"},{"id":"1020"},{"id":"1021"},{"id":"1022"},{"id":"1023"},{"id":"1024"},{"id":"1025"},{"id":"1302"},{"id":"1305"}]},"id":"1027","type":"Toolbar"},{"attributes":{},"id":"1200","type":"RedoTool"},{"attributes":{},"id":"1202","type":"SaveTool"},{"attributes":{"format":"0,0.[00]%"},"id":"1085","type":"NumeralTickFormatter"},{"attributes":{"children":[{"id":"1372"},{"id":"1374"}],"sizing_mode":"stretch_width"},"id":"1375","type":"Row"},{"attributes":{"bounds":[-35.65,748.65],"end":713,"js_property_callbacks":{"change:end":[{"id":"1304"}]},"min_interval":10},"id":"1002","type":"Range1d"},{"attributes":{"logo":null,"toolbars":[{"id":"1064"},{"id":"1204"},{"id":"1027"},{"id":"1253"}],"tools":[{"id":"1056"},{"id":"1057"},{"id":"1058"},{"id":"1059"},{"id":"1060"},{"id":"1061"},{"i
